// contracts/LoanItem.sol
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;


import"./LitemCalendar.sol";
import"./ItemTemplate.sol";
contract LoanItem {


    Calendar Calendario;


     mapping(address => bool) public permissions;
     mapping(uint256 => uint256) public Cds;

     mapping(address =>Selling[]) public UserSellingItem;
     mapping(uint256=>Selling) public SellingItem;
     mapping(address=>bool) public SellItem;
     uint256 countitem;
     uint256 orders;


     mapping(address =>LItem[]) public UserLoaningItem;
     //mapping(uint256=>LItem) public LoaningItem;

     mapping(address=>bool) public LoanItem;

     mapping(uint256=>PreItem)public PreLItem;
     mapping(uint256=>address[]) public CautionId;

    address public owner;

  struct LItem{
    ItemTemplate Item;
    address addr;
    uint CoinId;
    uint256 price;
    uint256 caution;
    string place;
    } 
    event LoanCreated(
    ItemTemplate Item,
    address addr,
    uint CoinId,
    uint256 price,
    uint256 caution,
    string place,
    uint time
      );
  struct PreItem{
    address from;
    address to;
    address item;
    uint time;
    uint timeS;
    uint timeE;
    uint idOrder;
  }

  event LoanPre(
    address from,
    address to,
    address item,
    uint time,
    uint timeS,
    uint timeE,
    uint idOrder,
    string staus
     );


  struct Selling {
    ItemTemplate Item;
    address addr;
    uint256 CoinId;
    uint256 price;
    string  place;
  }
  event SellingCreated(
    ItemTemplate Item,
    address addr,
    uint256 CoinId,
    uint256 price,
    string  place,
    uint256 time
  );
  event SoldItem(
    address from,
    address to,
    uint256 price,
    uint256 time,
    address itemaddr
    );


  constructor(address _owner,Calendar Cad) public  {  
         owner = _owner;
         permissions[owner]= true;
         Calendario = Cad;
         }


/*
    modifier propriety(){ 

        require (msg.sender == owner || permissions[msg.sender]== true , "Solo il proprietario");       
        _;
    }*/

    function SellIt(address itemaddr,address buyer) public{
      ItemTemplate ItemtoSell = ItemTemplate(itemaddr);
      require(bytes(ItemtoSell._name()).length > 0 );

      if(SellItem[itemaddr]==true){
        address ownerItem = ItemtoSell.ownerOf(ItemtoSell._id());
